  // Fondos base64 para cada hotel
  const fondos = {
 
 "fogo": "data:image/jpeg;base64,",
 fontan: "data:image/jpeg;base64,",
  marquis: "data:image/jpeg;base64," // <- aquí va la base64 de Marquis
    };


document.addEventListener("DOMContentLoaded", function () {
  const form = document.getElementById("invitationForm");

  form.addEventListener("submit", function (e) {
    e.preventDefault();

    const { jsPDF } = window.jspdf;

    const nombre = document.getElementById("nombre").value.trim();
    const estadoCivil = document.getElementById("estadoCivil").value;
    const personas = document.getElementById("mesaDescripcion").value;
    const hora = document.getElementById("horaCita").value;
    const fecha = document.getElementById("diaEvento").value;
    const celular = document.getElementById("celular").value;
    const codigo = document.getElementById("codigo").value;
    const hotelSeleccionado = document.getElementById("hotel").value;

    if (!hotelSeleccionado) {
      alert("Por favor selecciona un hotel.");
      return;
    }

    const doc = new jsPDF();
    const fondoClave = hotelSeleccionado.toLowerCase().includes("fogo") ? "fogo" : hotelSeleccionado;
    doc.addImage(fondos[fondoClave], "PNG", 0, 0, 210, 297);
    doc.setTextColor(255, 255, 255);

    const acompanantes = Array.from(document.getElementsByClassName("acompanante"))
      .map(input => input.value.trim())
      .filter(val => val !== "");

    let saludo = "";
    const estadosMasculinos = ["soltero", "casado", "unión libre", "divorciado", "viudo"];
    if (acompanantes.length > 0) {
      saludo = `ESTIMADOS: ${nombre.toUpperCase()} Y ${acompanantes.join(" Y ").toUpperCase()}`;
    } else {
      saludo = estadosMasculinos.includes(estadoCivil.toLowerCase())
        ? `ESTIMADO: ${nombre.toUpperCase()}`
        : `ESTIMADA: ${nombre.toUpperCase()}`;
    }

    doc.setFont("helvetica", "bold");
    doc.setFontSize(11);
    const saludoY = fondoClave === "fontan" ? 70 : 80;
    doc.text(saludo, 105, saludoY, { align: "center" });

    doc.setDrawColor(255, 255, 255);
    doc.setLineWidth(0.5);
    doc.line(25, saludoY + 4, 160, saludoY + 4);

    doc.setFont("helvetica", "normal");

    // Ajustes de posición
    let x = fondoClave === "fogo" ? 20 : 25;
    let textoMaxWidth = fondoClave === "fogo" ? 130 : 160;
    const inicioY = saludoY + 12;

    const horaFormateada = convertirHoraAMPM(hora);

    doc.text(`Estado Civil: ${estadoCivil}`, x, inicioY);
    doc.text(`Mesa: ${personas.toUpperCase()}`, x, inicioY + 6);
    doc.text(`Hora de la cita: ${horaFormateada}`, x, inicioY + 12);
    doc.text(`Día del evento: ${fecha}`, x, inicioY + 18);

    let y = inicioY + 30;
    let ubicacionHotel = "#";
    if (fondoClave === "marquis") {
      ubicacionHotel = "https://maps.app.goo.gl/PoFQwAKxVKAfG4Cr7";
    } else if (fondoClave === "fontan") {
      ubicacionHotel = "https://maps.app.goo.gl/UVjAHobxNAHP5bwu9";
    } else if (fondoClave === "fogo") {
      ubicacionHotel = "https://maps.app.goo.gl/LC3zgWA1BU9JGcwN9";
    }

    doc.setFont("helvetica", "bold");
    // Reducir letra para fogo
    doc.setFontSize(fondoClave === "fogo" ? 10 : 11);
    const eventoTexto = "En este evento contaremos con:";
    const eventoWidth = doc.getTextWidth(eventoTexto);
    doc.text(eventoTexto, (doc.internal.pageSize.getWidth() - eventoWidth) / 2, y);
    y += 6;

    doc.setFont("helvetica", "normal");
    const items = [
      "Alimentos en cortesía.",
      "Atención personalizada para cada uno de nuestros invitados.",
      `Clave de acceso: ${codigo}`
    ];
    items.forEach(item => {
      doc.circle(x, y - 2, 1.5, "F");
      doc.text(item, x + 8, y);
      y += 6;
    });

    y += 7;
    doc.setFont("helvetica", "bold");
    const hotelNombre = hotelSeleccionado;
    doc.text(`El evento es patrocinado por Destination Connect Group en el ${hotelNombre}...`, x, y);
    y += 5;

    const textoDetalles = [
      `Ubicación del Hotel: ${ubicacionHotel}`,
      "Recibirás un certificado de hospedaje vacacional válido por 4 días y 3 noches...",
      "¡Si no tienes fecha de viaje no te preocupes tienes medio año de vigencia!"
    ];

    textoDetalles.forEach((t, index) => {
      const lines = doc.splitTextToSize(t, textoMaxWidth);
      if (index === 0) {
        doc.setTextColor(255, 255, 255);
        doc.text("Ubicación del Hotel:", x, y);
        const labelWidth = doc.getTextWidth("Ubicación del Hotel: ");
        doc.setTextColor(0, 102, 204);
        doc.textWithLink(ubicacionHotel, x + labelWidth + 1, y, { url: ubicacionHotel });
        doc.setTextColor(255, 255, 255);
        y += 7;
      } else {
        doc.text(lines, x, y);
        // Reducir espacio entre líneas solo para fogo
        y += lines.length * (fondoClave === "fogo" ? 5 : 7);
      }
    });

    y += 6;
    doc.setFont("helvetica", "bold");
    doc.setFontSize(fondoClave === "fogo" ? 9 : 10);
    doc.text("Para acceder al evento y recoger su obsequio es indispensable:", x, y);
    y += 6;

    if (fondoClave === "marquis") {
      const requisitosCol1 = [
        "Mostrar cualquier identificación vigente (INE y/o PASAPORTE).",
        "Identificarse con tarjeta vigente de crédito y/o débito vigente Visa, MasterCard o AMEX."
      ];
      const requisitosCol2 = [
        "Contar con el tiempo estimado de 90 minutos.",
        "Indispensable en caso de ser casado o vivir en unión libre nos acompañen en pareja."
      ];

      const col1X = x;
      const col2X = 110;
      const lineHeight = 12;

      doc.setFont("helvetica", "normal");
      doc.setFontSize(10);

      requisitosCol1.forEach((text, i) => {
        doc.circle(col1X, y + i * lineHeight - 1, 1.5, "F");
        doc.text(doc.splitTextToSize(text, 75), col1X + 8, y + i * lineHeight);
      });

      requisitosCol2.forEach((text, i) => {
        doc.circle(col2X, y + i * lineHeight - 1, 1.5, "F");
        doc.text(doc.splitTextToSize(text, 75), col2X + 8, y + i * lineHeight);
      });

      y += Math.max(requisitosCol1.length, requisitosCol2.length) * lineHeight + 5;
    } else {
      doc.setFont("helvetica", "normal");
      doc.setFontSize(fondoClave === "fogo" ? 10 : 11);

      const requisitos = [
        ['Mostrar cualquier identificación vigente', '(INE y/o PASAPORTE).'],
        ['Contar con el tiempo estimado de 90 minutos.', ''],
        ['Identificarse como tarjetahabiente crédito y/o', 'débito vigente Visa, MasterCard o AMEX.'],
        ['Indispensable en caso de ser casado o', 'vivir en unión libre', 'nos acompañen en pareja.']
      ];

      requisitos.forEach(text => {
        doc.circle(x, y - 1, 1.5, "F");
        const lines = doc.splitTextToSize(text, textoMaxWidth);
        doc.text(lines, x + 8, y);
        y += lines.length * (fondoClave === "fogo" ? 5 : 7);
      });
    }

    // Descargar PDF
    const blob = doc.output('blob');
    const pdfUrl = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = pdfUrl;
    a.download = `Invitacion_${nombre.replace(/\s+/g, "_")}.pdf`;
    a.click();

    // WhatsApp
    const mensaje = encodeURIComponent(`Hola ${nombre}, le hago llegar su invitación para el evento del ${fecha} a las ${horaFormateada} en el ${hotelNombre}.`);
    const whatsappURL = `https://wa.me/52${celular}?text=${mensaje}`;
    window.open(whatsappURL, 'whatsappWindow', 'width=800,height=600');

    setTimeout(() => location.reload(), 1000);
  });

  // Hora formato AM/PM
  function convertirHoraAMPM(hora24) {
    const [hora, minutos] = hora24.split(":");
    const h = parseInt(hora, 10);
    const ampm = h >= 12 ? "PM" : "AM";
    const hora12 = h % 12 || 12;
    return `${hora12}:${minutos} ${ampm}`;
  }

  // Agregar acompañantes
  document.getElementById("agregarAcompananteBtn").addEventListener("click", function () {
    const container = document.getElementById("acompanantesContainer");
    const input = document.createElement("input");
    input.type = "text";
    input.placeholder = "Nombre del Acompañante";
    input.className = "acompanante";
    container.appendChild(input);
  });
});